import React from "react";
import Entry from "./Entry.jsx";
import emojipedia from "../emojipedia";

function App() {
  return (
    <div>
      <h1>
        <span>emojipedia</span>
      </h1>

      <dl className="dictionary">
        <Entry 
        emoji={emojipedia.emoji} 
        name={emojipedia.name} 
        meaning={emojipedia.meaning}/>
        <Entry/>
        <Entry/>
      </dl>
    </div>
  );
}

export default App;
